is_package: true
container:
  type: HtmlTemplate
  properties: {html: '@theme:standard-page.html'}
  event_bindings: {show: form_show}
components:
- type: FlowPanel
  properties: {}
  name: navbar_links
  layout_properties: {slot: nav-right}
  components:
  - type: Link
    properties: {role: null, url: '', align: left, tooltip: '', border: '', foreground: '',
      visible: true, text: Logout, font_size: 12, wrap_on: mobile, font: '', col_spacing: medium,
      spacing_above: none, icon_align: right, col_widths: '', spacing_below: none,
      italic: false, background: '', bold: false, underline: false, icon: 'fa:sign-out'}
