    layout_properties: {}
    event_bindings: {click: logout_click}
- type: Image
  properties: {role: top-icon, vertical_align: center, height: 32, tooltip: '', border: '',
    foreground: '', visible: true, display_mode: fill_width, spacing_above: medium,
    source: 'data:image/png;base64,',
    spacing_below: none, background: '', horizontal_align: left}
  name: logo
  layout_properties: {slot: top-left-btn}
- type: Link
  properties: {role: top-home-icon, url: '', align: left, tooltip: '', border: '',
    foreground: '', visible: true, text: '', font_size: null, wrap_on: mobile, font: '',
